import React, { useEffect, useState } from 'react';
import { Table } from  'react-bootstrap';

const List = (props) =>{

    return (
        <Table hover>
            <thead>
                <tr>
                    <th>#</th>
                    <th>Nome</th>
                    <th>{props.title == "Álbuns encontrados" ? "Artista" : "Ouvintes"}</th>
                    <th>?</th>
                </tr>
            </thead>
            <tbody>
                {
                    props.title == "Álbuns encontrados" ?
                    props.values.map

                    :
                    props.values.map((value, index) => {
                        return(
                            <tr>
                                <th scope="row">{index + 1}</th>
                                <td>{value.name}</td>
                                <td>{value.listeners}</td>
                                <td></td>
                            </tr>
                        );
                    })
                }
            </tbody>
        </Table>
    );
}

export default List;
